import React, { useState } from "react";
import {
  Container,
  Row,
  Col,
  Button,
  Card,
  CardBody,
  CardTitle,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
  Media,
  Table,
} from "reactstrap";


//Import Breadcrumb
import Breadcrumbs from "../../../components/Common/Breadcrumb";

import ExamList from './ExamList'

//i18n
import { withNamespaces } from "react-i18next";

const Exam = (props) => {


  return (
    <React.Fragment>
      <div className="page-content">
        <Container fluid>
          {/* Render Breadcrumb */}
          <Breadcrumbs
            title={props.t("Exam")}
          />
          <ExamList/>
          </Container>
          </div>
    </React.Fragment>
  );
};

export default withNamespaces()(Exam);
